INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (1, 'Joker', 'In Gotham City, mentally troubled comedian Arthur Fleck is disregarded and mistreated by society. He then embarks on a downward spiral of revolution and bloody crime. This path brings him face-to-face with his alter-ego: the Joker.', 2019, 'https://m.media-amazon.com/images/M/MV5BNGVjNWI4ZGUtNzE0MS00YTJmLWE0ZDctN2ZiYTk2YmI3NTYyXkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_SX300.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (2, 'Terminator', 'A cyborg comes from the future, to kill a girl named Sarah Lee.', 1991, 'https://www.scifinow.co.uk/wp-content/uploads/2019/09/terminator_dark_fate_ver6-300x444.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (3, 'Inside Out', 'After young Riley is uprooted from her Midwest life and moved to San Francisco, her emotions - Joy, Fear, Anger, Disgust and Sadness - conflict on how best to navigate a new city, house, and school.', 2015, 'https://m.media-amazon.com/images/M/MV5BOTgxMDQwMDk0OF5BMl5BanBnXkFtZTgwNjU5OTg2NDE@._V1_SX300.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (4, 'Logan', 'In a future where mutants are nearly extinct, an elderly and weary Logan leads a quiet life. But when Laura, a mutant child pursued by scientists, comes to him for help, he must get her to safety.', 2017, 'https://m.media-amazon.com/images/M/MV5BYzc5MTU4N2EtYTkyMi00NjdhLTg3NWEtMTY4OTEyMzJhZTAzXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (5, 'The Wolf of Wall Street', 'Based on the true story of Jordan Belfort, from his rise to a wealthy stock-broker living the high life to his fall involving crime, corruption and the federal government.', 2013, 'https://m.media-amazon.com/images/M/MV5BMjIxMjgxNTk0MF5BMl5BanBnXkFtZTgwNjIyOTg2MDE@._V1_SX300.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (6, 'How to Train Your Dragon', 'A hapless young Viking who aspires to hunt dragons becomes the unlikely friend of a young dragon himself, and learns there may be more to the creatures than he assumed.', 2010, 'https://m.media-amazon.com/images/M/MV5BMjA5NDQyMjc2NF5BMl5BanBnXkFtZTcwMjg5ODcyMw@@._V1_SX300.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (7, 'Inception', 'A thief who steals corporate secrets through the use of dream-sharing technology is given the inverse task of planting an idea into the mind of a C.E.O., but his tragic past may doom the project and his team to disaster.', 2010, 'https://m.media-amazon.com/images/M/MV5BMjAxMzY3NjcxNF5BMl5BanBnXkFtZTcwNTI5OTM0Mw@@._V1_SX300.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (8, 'Gladiator', 'A former Roman General sets out to exact vengeance against the corrupt emperor who murdered his family and sent him into slavery.', 2000, 'https://m.media-amazon.com/images/M/MV5BMDliMmNhNDEtODUyOS00MjNlLTgxODEtN2U3NzIxMGVkZTA1L2ltYWdlXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (9, 'Coco', 'Aspiring musician Miguel, confronted with his family\'s ancestral ban on music, enters the Land of the Dead to find his great-great-grandfather, a legendary singer.', 2017, 'https://m.media-amazon.com/images/M/MV5BYjQ5NjM0Y2YtNjZkNC00ZDhkLWJjMWItN2QyNzFkMDE3ZjAxXkEyXkFqcGdeQXVyODIxMzk5NjA@._V1_SX300.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
INSERT INTO catalogo.movies (id, title, synopsis, year, cover, created_at, updated_at) VALUES (10, 'Ford v Ferrari', 'American car designer Carroll Shelby and driver Ken Miles battle corporate interference and the laws of physics to build a revolutionary race car for Ford in order to defeat Ferrari at the 24 Hours of Le Mans in 1966.', 2019, 'https://m.media-amazon.com/images/M/MV5BM2UwMDVmMDItM2I2Yi00NGZmLTk4ZTUtY2JjNTQ3OGQ5ZjM2XkEyXkFqcGdeQXVyMTA1OTYzOTUx._V1_SX300.jpg', '2024-09-23 05:53:08', '2024-09-23 05:53:08');
